fn generate_workout(intensity: u32, random_number: u32) { let expensive_result = simulated_expensive_calculation(intensity); if intensity < 25 { println!( "Bugün, {} şınav çek!", expensive_result ); println!( "Sonrasında {} mekik çek!", expensive_result ); } else { if random_number == 3 { println!("Bugün mola ver! Sıvı tüketmeyi de ihmal etme!"); } else { println!( "Bugün, {} dakika koş!", expensive_result ); } }
