fn generate_workout(intensity: u32, random_number: u32) { let expensive_closure = |num| { println!("yavaş bir hesaplama..."); thread::sleep(Duration::from_secs(2)); num }; if intensity < 25 { println!( "Bugün, {} şınav çek!", expensive_closure(intensity) ); println!( "Sonrasında {} mekik çek!", expensive_closure(intensity) ); } else { if random_number == 3 { println!("Bugün mola ver! Sıvı tüketmeyi de ihmal etme!"); } else { println!( "Bugün, {} dakika koş!", expensive_closure(intensity) ); } }
