#} Örnek 13-11:Önbellek mantığını soyutlamak için generate_workout işlevinde Cacher yapısını kullanmak Böylelikle kapamayı doğrudan bir değişkene kaydetmek yerine, bu kapamayı tutması için yeni bir Cacher örneğini kaydediyoruz. Bu noktadan itibaren sonuca ihtiyacımız olan her yerde, Cacher yapısının bir örneğini oluşturup, value metodunu çağırırarak tembelce hesaplanan sonuca ulaşırız. Ayrıca pahalı hesaplama sonucunu döndüren expensive_result işlevi en fazla bir kez çağırılacağından value yöntemini çağırmak tercihimize kalmıştır. Bu programı örnek 13-2' deki main işleviyle çalıştırmayı deneyin. Tüm if ve else bloklarında, yavaşça hesaplanıyor... çıktısının sadece bir kez ve gerektiğinde göründüğünü test edebilmeniz için simulated_user_specified_value ve simulated_random_number değişken değerlerini dilediğiniz kadar değiştirebilirsiniz. Cacher ön bellek yapısı, pahalı hesaplamayı ihtiyacımız kadar çağırarak create_workout iş mantığına rahatlıkla odaklanabilir.

