Tüm yineleyiciler standart kitaplıkta tanımlanan Iterator adlı bir özelliği uygular. Özelliğin tanımı şuna benzer: #![allow(unused_variables)]
fn main() { pub trait Iterator { type Item; fn next(&mut self) -> Option<Self::Item>; // Şu an için varsayılan uygulamaları gösterilmeyen metodlar }
} Bu tanımda type Item ve Self::Item gibi bu özelliklerle ilişkilendirilmiş türü bildiren yeni söz dizimleri kullanıldığına dikkat edin. İlişkili türlerden bölüm 19’da ayrıntılı olarak bahsedeceğimizden şimdilik bilmeniz gereken tek şey; bu kodun yineleyici özelliğini ( Itarator trait ) uygulayabilmek için bir öğe türü ( Item type ) tanımlanması gerektiği ve bu öğe türünün next metodunun dönüş türünde kullanıldığını belirtmesidir. Başka bir deyişle öğe türü yineleyiciden döndürülen tür olacaktır. Yineleyici özelliği uygulayıcılara sadece bir metodu tanımlamak için ihtiyaç duyar. Tanımlanan next metodu yineleme devam ettiği sürece öğeleri Some ile sarmalayarak birer birer döndürürken, yineleme sona erdiğinde None döndürecektir. Yineleyicideki next metodunu doğrudan kendimiz de çağırabiliriz. Örnek 13-15'te, v1 vektöründe oluşturulan yineleyiciye yapılan çağrılardan next metoduna hangi değerlerin döndürüldüğü gösterilmektedir. Dosya adı: src/lib.rs #[cfg(test)]
mod tests { #[test] fn iterator_demonstration() { let v1 = vec![1, 2, 3]; let mut v1_iter = v1.iter(); assert_eq!(v1_iter.next(), Some(&1)); assert_eq!(v1_iter.next(), Some(&2)); assert_eq!(v1_iter.next(), Some(&3)); assert_eq!(v1_iter.next(), None); }
} fn main() {} Örnek 13-15: Yineleyicideki next metodunu çağırmak Öncelikle v1_iter değişmezinin mut anahtar sözcüğüyle değişebilir hale dönüştürülmesi gerektiğine dikkat edin. Bir yineleyicide next metodunun çağrılması, yineleyicinin dizide bulunduğu yeri izlemek için kullandığı iç konumu değiştirir. Başka bir deyişle, metodu çağıran kod yineleyiciyi tüketir veya kullanır. Her next metodu çağrısı yineleyicide bir öğenin tüketilmesine neden olur. Oysa v1_iter değişkeni for döngüsü ile kullanıldığında, değişkenin mülkiyeti döngüye aktarıldığından, durumu perde arkasında değişebilir olarak değiştirilir ve böylelikle v1_iter değişmezinin değişebilir olarak dönüştürülmesine gerek duyulmaz. Ayrıca next metodu çağrılarından aldığımız değerlerin, vektör elemanlarının değişmez referansları olduğunu ve Iter metodunun değişmez referanslar üzerinde bir yineleyici oluşturduğunu unutmayın. Eğer v1 vektörünün mülkiyetini alarak, sahip olunan değerleri döndürecek bir yineleyici oluşturmak istiyorsanız, iter yerine into_iter metodunu çağırabilirsiniz. Benzer şekilde, değişebilir referanslar üzerinde yineleme yapmanız gerektiğinde, iter kullanmak yerine, iter_mut metodunu kullanabilirsiniz.

