Paketlerinizin doğru biçimde belgelenmesi, bu paketlerin başka kullanıcılar tarafından nasıl ve ne zaman kullanılabileceğine ışık tutacağından, belgeleme sürecine zaman ayırmak önemlidir. Bölüm 3'te, Rust kodlarını iki eğik çizgi // kullanarak nasıl yorumlayacağımızı tartışmıştık. Bu normal yorumların yanısıra Rust, belgeleme yorumları olarak bilinen ve kod içinde yapılan açıklamaları, HTML belgelerine çevirmeye yarayan özel bir yorumlama biçimine sahiptir. Bu HTML belgeleri, sandığınızın nasıl uygulandığını anlatmaktan ziyade, nasıl kullanılacağını öğrenmek isteyen programcılara yol gösteren genel API öğelerinin belgelenmiş içeriğinden oluşur. Belgeledikleri öğeden hemen önce yerleştirilen ve iki yerine /// üç eğik çizgi ile ifade edilen belgeleme yorumları, metni biçimlendirmek için Markdown gösterimini destekler. Örnek 14-1, sandigim adlı sandıkta yer alan bir_ekle işlevi için belgeleme yorumlarını göstermektedir: Dosya adı: src/lib.rs /// Kendisine iletilen sayıya bir ekler
///
/// # Örnekler
///
/// ```
/// let deger = 5;
/// let yanit = sandigim::bir_ekle(deger);
///
/// assert_eq!(6, yanit);
/// ``` pub fn bir_ekle(x: i32) -> i32 { x + 1
} Örnek 14-1: Bir işlevin belgelenmesi Örnekteki bir_ekle işlevinin görevini anlatıp, Örnekler etiketli bir bölüm başlatarak bir_ekle işlevinin nasıl kullanılacağını gösteren kodlarla başlıyoruz. Bu işlemleri tamamladıktan sonra cargo doc komutunu çalıştırarak bu yorum satırlarının işlenmesiyle oluşturulan bir HTML belgesine sahip oluruz. Bu komutla oluşturulan HTML belgeleri rustdoc araç seti çalıştırılarak target/doc dizinine yerleştirilecektir. Biraz daha rahatlık sağlayan cargo doc --open komutu ise, hem sandığınıza ait tüm bağımlılıkların HTML belgelerini oluşturacak, hem de oluşturduğu belgeleri web tarayıcınızda açarak kullanımınıza sunacaktır. Şimdi bir_ekle işlevine giderek, Resim 14-1'de gösterilen belgeleme yorumlarının metne nasıl dönüştürüldüğünü inceleyebilirsiniz: Resim 14-1: bir_ekle işlevinin HTML belgeleri Yaygın Olarak Kullanılan Bölümler HTML belgesinde # Örnekler başlıklı bir bölüm oluşturabilmek için Örnek 14-1'de # Örnek şeklinde bir Markdown başlığı sözdizimi kullandık. Pek çok sandık yazarının belgelerinde yaygın olarak kullandığı bazı bölümler ise aşağıda sıralanmaktadır: Panikler: Belgelenen işlevin panik üretebileceği senaryolar. İşlevin çağrıldığı programlarda panik üretmesi istenmiyorsa, kullanıcıların bu senaryoların gerçekleşebileceği durumlarda işlevi çağırmadıklarından emin olunmalıdır. Hatalar: İşlev bir Result türü döndürdüğünde, oluşması muhtemel hata çeşitlerinin ve bu hataların döndürülme neden ve koşullarının tanımlanması, işlevi çağıran tarafların farklı türden hataları farklı şekillerde işlemelerini sağlayacak şekilde kod üretmelerine yardımcı olabilir. Güvenlik: Eğer işlev çağrısı unsafe yani emniyetsiz bir çağrı ise (Rust'ın emniyetsiz kullanım seçeneğini Bölüm 19'da tartışacağız), işlevin güvensiz olma nedenlerini açıklayan ve çağıran tarafların desteklemesi gereken değişmezleri kapsayan bir bölüm olmalıdır. Çoğu belgelendirme çalışmasında bu bölümlerin her birinin yorumlanmasına ihtiyaç duyulmaz. Bununla birlikte bu bölümler kodlarınızı çağıran tarafların bilmek isteyeceği yönleri hatırlamanız amacıyla tavsiye edilen bir kontrol listesidir. Test Amaçlı Belgeleme Yorumları Belgeleme yorumlarınıza örnek kod blokları eklemek, kütüphanenizin nasıl kullanılacağını göstermenize yardımcı olabileceği gibi ek bir avantaj olarak cargo test komutu çalıştırıldığında kod örneklerinizin test edilmesine olanak sağlar. Hiçbir şey test edilebilecek örnekler içeren belgelerden daha iyi olamaz. Ancak, belgeleme sonrası gerçekleşen kod değişiklikleri yüzünden işe yaramayan örneklerden daha kötü bir şey de yoktur. Örnek 14-1'deki bir_ekle işlevi için oluşturduğumuz belgeleme koduna cargo test komutunu uyguladığımızda, aşağıdakine benzer bir test sonucu göreceğiz: Doc-tests sandigim running 1 test
test src/lib.rs - bir_ekle (line 5) ... ok test result: ok. 1 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out Bu aşamada işlev ya da örnek değiştirilecek olursa, örnekteki assert_eq! ifadesi panik üreteceğinden cargo test komutu tekrar çalıştırıldığında, test sürecinin örnek ve kod bölümlerinin uyumsuzluğunu fark ettiğini gözlemleyeceğiz. İçerilen Öğelerin Yorumlanması Bir başka belgeleme biçimi olan //! ise, yorum satırlarının hemen altına eklenenen öğeleri belgelemek yerine, yorumun ait olduğu, yani içerildiği öğeyi belgelemek için kullanılır. Bu tarz yorum satırlarını genellikle sandık veya modülün tamamını bir bütün olarak belgelemek amacıyla, kök dosyasının içinde (kural gereği src/lib.src) ya da bir modül içerisinde kullanırız. Örnek 14-2'de gösterildiği gibi, eğer daha önce oluşturduğumuz ve bir_ekle işlevini içeren sandigim için, bu sandığın amacını açıklayan belgeler eklemek istiyorsak, bunları src/lib.rs dosyasının en başına //! işaretini kullanarak eklememiz gerekir. Dosya adı: src/lib.rs //! # Sandigim
//!
//! `Sandigim`, bazı hesaplamaların daha kolay yapılmasını
//! sağlayan araçlar koleksiyonudur. /// Kendisine iletilen rakama 1 ekler.
// --snip--
#///
#/// # Örnekler
#///
#/// ```
#/// let rakam = 5;
#/// let yanit = sandigim::bir_ekle(rakam);
#///
#/// assert_eq!(6, yanit);
#/// ```
#pub fn add_one(x: i32) -> i32 {
# x + 1
#} Örnek 14-2: Bir bütün olarak Sandigim belgeleri //! işaretiyle başlayan son satırın altında herhangi bir kod satırının bulunmadığına ve bir satırın boş bırakılmış olduğuna dikkat edin! Bunun sebebi, içerilen belge yorumlarını /// yerine, //! işaretiyle başlattığımızdan sonraki satırlarda bulunan öğeler yerine, işaretin bulunduğu satırdaki öğelerin belgelenecek olmasıdır. Bu durumda bu yorumu içeren öğe, sandık kökümüz olan src/lib.rs dosyası olacağından, bu yorumlar da sandığın tamamı için yapılan açıklamaları içerecektir. Eğer cargo doc --open komutunu çalıştırırsak, işaretlemiş olduğumuz bu yorum satırları, tıpkı Şekil 14-2'de gösterildiği gibi sandigim belgesinin ön sayfasında, sandıktaki genel öğeler listesinin üstünde görüntülenecektir: Resim 14-2: Sandigim 'ın tamamını içeren yorumlarla oluşturulmuş HTML belgeleri Öğelerdeki belge yorumları, özellikle sandık ve modülleri tanımlamak için kullanışlıdır. Bu yorumları, paketlerinizi kullanacak olan kişilerin paket düzeninizi anlamalarına yardımcı olmak ve paket kapsamının genel amacını açıklamak için kullanmanız önemlidir.

