Bölüm 7'de kodlarımız, mod anahtar kelimesini kullanarak modüller halinde nasıl düzenleyeceğinizi, pub anahtar sözcüğüyle öğelerin nasıl genelleştirileceğini ve use anahtar kelimesiyle de öğelerin kapsama nasıl dahil edileceğini incelemiştik. Ancak, bir sandığın geliştirilme sürecinde sizin için anlamlı olan organizasyon yapısı, kullanıcılarınız için çok uygun olmayabilir. Sandığınızı çok katmanlı ve hiyerarşik bir yapıda düzenlediğinizde, bu hiyerarşinin alt katmanlarında tanımlanmış bir türü kullanmak isteyen kişiler, bu türe erişmekte sorun yaşayabilirler. Hem ayrıca bir türe use sandigim::KullanisliBirTur; şeklinde bir söz dizimiyle ulaşmak yerine, sandigim::bir_modul::baska_bir_modul::KullanisliBirTur; şeklinde bir söz dizimiyle ulaşmak oldukça rahatsız edici olabilir. Bir sandık yayınlarken herkese açık olarak tasarlanmış olan API'nizin yapısı oldukça önemlidir. Sandığınızı kullanan kişiler bu yapıya sizin kadar aşina olmadıklarından, sandığınız büyüyüp karmaşık bir modüller hiyerarşisine dönüştüğünde, kullanmak istedikleri API parçalarına ulaşmakta zorluk çekebilirler. İyi haber şu ki, eğer organizasyon yapınız başkaları tarafından farklı kütüphaneler ile kullanılamayacak gibiyse, API hiyerarşisini veya tasarımını baştan sona yeniden düzenlemek yerine, pub use anahtar kelimesini kullanarak, bu yapının genel kullanıma uygun bir sürümünü tüm öğeleriyle birlikte yeniden ihraç edebilirsiniz. Yeniden ihraç işleminde, bir konumda bulunan genel bir öğe yerinden alınarak, sanki başka bir yerde ve başka bir konumda tanımlanmış gibi herkese açık hale getirilir. Örnek 14-3'te de görüleceği gibi, sanatsal kavramları modellemek için sanat adında bir kütüphane tasarladığımızı varsayalım. Ve bu kütüphanenin içinde BirincilRenk ve IkincilRenk olarak isimlendirilmiş iki sıralamadan (enum) oluşan turler modülü ve karisim adında bir işlev içeren araclar modülü bulunsun: Dosya adı: src/lib.rs //! # Sanat
//!
//! Sanatsal kavramları modellemek için bir kütüphane. pub mod turler { /// RYB renk modeline göre ana renkler. pub enum BirincilRenk { Kizil, Sari, Mavi, } /// RYB renk modeline göre ikincil renkler. pub enum IkincilRenk { Portakal, Yesil, Mor, }
} pub mod araclar { use crate::turler::*; /// İkincil bir renk oluşturmak için iki ana rengi /// eşit miktarda birleştirir. pub fn karisim(c1: BirincilRenk, c2: BirincilRenk) -> IkincilRenk { // --snip--
# IkincilRenk::Portakal
# }
#} fn main() {} Örnek 14-3: turler ve araclar modülleri halinde düzenlenmiş öğeler içeren bir sanat kütüphanesi Resim 14-3, Bu sandık için cargo doc tarafından üretilen belgenin ön yüzünü göstermektedir: Resim 14-3: turler ve araclar modüllerini örnekleyen sanat sandığının ön yüzü Belgenin ön sayfasında BirincilRenk ve IkincilRenk türleriyle karisim işlevinin listelenmediğine dikkat edin. Onların görüntülenebilmesi için turler ve araclar bağlantılarının açılması gerekir. Bu kütüphaneye bağımlı olan başka bir sandığın, halihazırda tanımlanmış olan sanat modül yapısına ait öğeleri kendi kapsamına alabilmesi için use ifadesini kullanması gerekir. Örnek 14-4, sanat sandığındaki BirincilRenk ve karisim öğelerini kullanan başka bir sandık örneğini göstermektedir: Dosya adı: src/lib.rs use sanat::turler::BirincilRenk;
use sanat::araclar::karisim; fn main() { let kizil = BirincilRenk::Kizil; let sari = BirincilRenk::Sari; karistir(kizil, sari);
} Örnek 14-4: İç yapısı dışa aktarılan sanat sandığının öğelerini kullanan başka bir sandık Örnek 14-4'te yer alan sanat sandığını kullanan kodun programcısı, BirincilRenk türünün turler modülünde ve karisim işlevinin de araclar modülünde olduğunu anlayabilmelidir. Sandığın modül yapısı, sanat sandığını geliştiren programcılardan çok, bu sandığı kullanan programcılar için önemlidir. Sandığın parçalarını turler ve sanat modülleri olarak düzenleyen iç yapı, bu sandığın nasıl kullanılacağını öğrenmek isteyenler için herhangi bir yararlı bilgi içermediği gibi, sanat sandığı modül yapısının yarattığı karmaşa, use ifadelerinde modül adlarını belirtmek isteyen kullanıcıların nereye bakacaklarını karıştırmalarına neden olacağından kullanışsız bir yapıdır. Herkesin kullanacağı bu API'nin sorunlu iç düzenlemesini pub use kullanarak kaldırıp, öğeleri en üst düzeyde yeniden dışa aktarabilmek için, Örnek 14-3'te yer alan sanat sandığının kodlarını, Örnek 14-5'te gösterildiği şekilde yeniden düzenleyebiliriz. Dosya adı: src/lib.rs //! # Sanat
