}
#
#fn main() {} Örnek 14-5: Öğeleri yeniden dışa aktarmak için pub use ifadesi eklemek Şekil 14-4'te görebileceğiniz gibi cargo doc komutunun bu sandık için oluşturduğu API belgeleri, dışa aktarımları yeniden ön sayfada listeleyerek bağlayacak, BirincilRenk ve IkincilRenk türleriyle karisim işlevinin bulunmasını oldukça kolaylaştıracaktır. Resim 14-4: Yeniden dışa aktarımı örnekleyen sanat sandığının ön yüzü Artk sanat sandığını kullanmak isteyen programcılar, ister hâlâ kullanılmaya uygun durumdaki Örnek 14-3 ve Örnek 14-4'ün iç yapılarını inceleyerek kodlarına bunları dahil edebilirler, isterlerse Örnek 14-5 ve 14-6'da yenilenerek kullanıma daha uygun hale getirilen yapıyı tercih edebilirler. Dosya adı: src/main.rs use sanat::karisim;
use sanat::BirincilRenk; fn main() { // --snip--
# let kizil = BirincilRenk::Kizil;
# let sari = BirincilRenk::Sari;
# karisim(kizil, sari);
} Örnek 14-6: sanat sandığının yeniden dışa aktarılan öğelerini kullanan bir program İç içe geçmiş çok sayıda modülü, türleri pub use ifadesiyle en üst düzeyde yeniden dışa aktarmak, sandığı kullanacak kişilerin deneyimlerinde önemli farklar yaratabilir. Kullanışlı bir genel API tasarımı oluşturmak bilimden çok sanat olarak kabul edildiğinden, kullanıcılarınız için en iyi çalışacak uygun bir düzenleme için defalarca tekrar yapmanız gerekebilir. Bununla birlikte pub use kullanımını seçmek, sandığınızın iç düzenlemesinde size esneklik sağlarken, bu iç düzeni kullanıcılarınıza sunduğunuz arayüzden ayırır. Kurduğunuz bazı sandıkların iç düzenlemelerinin genel API katmanlarına göre farklarını incelemek için bu sandıkların kodlarına bakmanız öğretici olacaktır.
